Defendant Kenneth C Roberson in court with Attorney Anne M Jaspers.  Defendant Kenneth C Roberson in custody.  Jesica A Ballenger appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

AS TO COUNT 1:  The defendant was advised of his constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.  Filed, Ineligible Voting Notice and Acknowledgement. 

AS TO COUNT 2:  Pursuant to plea negotiations and on motion of the state, the Court ordered Count 2 DISMISSED AND READ-IN for the purpose of sentencing. 


Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 45 MONTHS, CONSECUTIVE to any other sentence with credit for 47 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 21 MONTHS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 24 MONTHS.

The defendant IS NOT eligible for the Challenge Incarceration Program.  The defendant IS eligible for the Substance Abuse Program.  

The Court STAYED this sentence and placed the defendant on probation for a period of 3 YEARS with the following conditions.

CONDITIONS OF PROBATION/EXTENDED SUPERVISION:
*Serve 10 1/2 months in the House of Correction with release privileges for employment and treatment; if not employed release to the day reporting center for education, treatment, and work search.
*Obtain AODA assessment and complete follow-up care/treatment;
*Absolute sobriety with random urine screens and breathalyzer tests;
*No illegal drug dealing or association with drug community (drug users/dealers/houses);
*Cooperate with all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Obtain/maintain full time employment or full time school with part time employment;
*Obtain GED or HSED;
*Pay all supervision fees;
*Provide DNA sample- pay surcharge;

The Court ordered defendant to pay a fine of $2400.00 plus all mandatory costs, penalties, surcharges, including $50.00 ignition interlock surcharge by the end of probation period- any remaining balance to convert to civil judgment.  Defendant may perform community service in a supervised setting in exchange for credit towards fine.  The Court orders that the defendant receive a $10 credit towards fine for every hour of community service performed (75 hours maximum).  Court ordered AODA assessment and Driver's Safety Plan.  Court ordered defendant's driving privileges revoked for a period of 36 months.  Court ordered defendant restricted to operation of vehicles equipped with an ignition interlock device for 18 months.  If revoked, the Court ordered that all financial obligations be paid by collection of these sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any remaining balance to convert to civil judgment.  Defendant is informed he may not possess and/or own any firearms.  Defendant is informed he may not vote in any election until his civil rights have been reinstated.  Appeal rights given. 
